import React from 'react';

const FavoritePage = () => {
    const favorites = JSON.parse(localStorage.getItem('favorites')) || [];

    return (
        <div>
            <h1>Favorites</h1>
            {favorites.length > 0 ? (
                <div>
                    {favorites.map((productId, index) => (
                        <div key={index}>
                            <p>product id: {productId}</p>
                        </div>
                    ))}
                </div>
            ) : (
                <p>No favorites added yet.</p>
            )}
        </div>
    );
};

export default FavoritePage;
